import './Sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebarcontainer">
      <div className="top">
      <div className="logo">LOGO.</div>
      </div>
      <div className="center">center</div>
      <div className="bottom">bot</div>

    </div>
  )
}

export default Sidebar
